ublic ListNode rotateRight(ListNode head, int k) {
        if(k==0 || head==null || head.next==null) return head;

        ListNode curr=null;
        ListNode prev=null;
        int len=0;
        curr=head;

        while(curr!=null){
            len++;
            prev=curr;
            curr=curr.next;
        }

        if(k>=len) k%=len;

        ////this approach rotates k times
        // for(int i=0;i<k;i++){
        //     curr=head;
        //     prev=null;
        //     while(curr.next!=null){
        //         prev=curr;
        //         curr=curr.next;
        //     }
        //     prev.next=null;
        //     curr.next=head;
        //     head=curr;
        // }

        //optimal approach is to make a CLL and cut at right lengh (len-k)
        prev.next=head; //CLL

        curr=head;
        for(int i=0;i<len-k;i++)
            curr=curr.next;

        head=curr.next;
        curr.next=null;

        return head;
    }

